Ultimate Africa Season 2

Nature, Travel Documentary hosted by Jean Du Plessis and published by Discovery Channel in 2008 - English narration


Information
------------------------------

Commissioned by Animal Planet and hosted by veteran safari guide Jean Du Plessis, Ultimate Africa is a documentary series that goes on a wild and exhilarating journey throughout east Africa. From raiding a poaching camp in a remote swamp to encountering human-versus-lion conflict outside a national park, this series studies the continent from the perspective of someone who understands the complexities and challenges of the region firsthand.

A fifth-generation South African, Du Plessis developed his love of African wildlife as a child in the foothills of the Draknsberg Mountains. After earning his business degree in tourism from the University of Pretoria, South Africa, Du Plessis participated in some of the most daring African safaris available. With experience as a game ranger in the Kalahari Desert, Du Plessis has also served as head ranger for various African hotels and is considered a pioneer in starting regular safari adventures across Tanzania.

In his latest Ultimate Africa adventure, Du Plessis' travels shed light on the conservation issues that are plaguing Africa today. What is behind the growing extinction of some of the world's most exotic animals? How do African primates survive habitat destruction? How do reserves sustain themselves through sport hunting?

From the plains of the Serengeti to the jungles of Mahale Mountains, Du Plessis explores these questions and more as each episode of the series presents an insider's look at the conservation and preservation challenges of African wildlife.


1)  Rhinos of Ol Pejeta 
Jean heads to Kenya to join an operation to mark and relocate 7 endangered rhinos. During the operation he goes off in search of a missing rhino named Millennium. The rangers had feared that may have been attacked by lions.

2)  Lost World of Gabon 
Jean ventures to Gabon West Africa where the country is looking to develop a tourism industry. There he explores wild beaches, and goes off in search of un-habituated gorillas. He also visits Kongou Falls, one of Africa's most spectacular waterfalls, where he learns that Chinese plan to build a hydro electric dam that will completely destroy the falls.

3)  Fugitives of Laikipia 
Jean returns to Ol Pejeta where management are forced to deal with problem elephants that use their tusks to break through electrified fence and raid local villagers crops.

4)  Shadows of the Serengeti 
A look at the efforts of the FCF anti-poaching team in the Maswa Game Reserve in Tanzania. Outside of professional hunter, few people ever visit Maswa, an area along the Western boundary of the Serengeti. Every year as the wildebeest migration passes through, the poachers move in. FCF will launch a major operation to push the poachers before the Migration heads through.

5)  Journeys into the Bush 
Jean takes viewers to some of his favorite spots in Tanzania. From walking elephant to hunting with the Hazabe Bushmen. Jean's trip is put into jeapordy by the eruption of the Ol Doinyo Lengai volcano.

